import React, {useEffect, useState} from 'react'
import {Box, Button, Stack, TextField, Typography} from '@mui/material'
import '../App.css'

const SearchExercises = () => {
    const [s, sets] = useState(initialState);

    return (
        <Stack alignItems="center" mt="37px" justifyContent="center" p = "20px">
            <Typography fontWeight={700} sx={{
                fontSize: {lg: '44px', xs: '30px'}
            }} mb = "50px" textAlign="center">Awesome Exercises you <br /> should know
            </Typography>
            <Box position="relative" mb = "72px">
                <input placeholder='Search Exercises' type="text" style={{border: "1px solid grey", borderRadius: "4px", padding: "11px", width: "300px", backgroundColor: "black", color: "white"}}/>

                <Button variant = "contained" color = "error" style={{backgroundColor: "#8B0000", paddingLeft: "30px", paddingRight: "30px", textTransform: "none", margin: "20px"}}>Search</Button>
                </Box>
        </Stack>
    )
}

export default SearchExercises
